App.factory("API",["$http",function(n){return{Employees:n.get("http://localhost:3685/API/Employees"),AddEmp:t=>n({method:"POST",url:"http://localhost:3685/API/Employee",data:t,headers:{"Content-Type":"application/json;charset=utf-8"}}),EditEmp:t=>n({method:"PUT",url:"http://localhost:3685/API/Employee",data:t,headers:{"Content-Type":"application/json;charset=utf-8"}}),DelEmp:t=>n({method:"DELETE",url:"http://localhost:3685/API/Employee",data:t,headers:{"Content-Type":"application/json;charset=utf-8"}}),Login:t=>n({method:"POST",url:"http://localhost:3685/API/Login",data:t,headers:{"Content-Type":"application/json;charset=utf-8"}}),AddUser:t=>n({method:"POST",url:"http://localhost:3685/API/User",data:t,headers:{"Content-Type":"application/json;charset=utf-8"}}),EditUser:t=>n({method:"PUT",url:"http://localhost:3685/API/User",data:t,headers:{"Content-Type":"application/json;charset=utf-8"}}),SendMsg:t=>n({method:"POST",url:"http://localhost:3685/API/Message",data:t,headers:{"Content-Type":"application/json;charset=utf-8"}})}}]);App.factory("LocalStorage",["$rootScope",function(){return{set:(n,t)=>{delete t.password,delete t.pass2,localStorage.setItem(n,JSON.stringify(t))},get:n=>JSON.parse(localStorage.getItem(n))}}]);